import Panel from './Panel';
import './PanelList.css';


const PanelList = ({ pokedex }) => {
    const [card, setCard] = useState(null)

    useEffect(() => {
        console.log(panelCompon[card]);
        let pickedCard = panelCompon[card];

    },[card]);


    // const functionForEvent = () => {
