    //     // console.log(PanelCompon[carNumb]);
    // }

    // const handleEvent = event => {
    //     console.log("handle enent trigger")
    //     functionForEvent();
    // }

    const panelCompon = pokedex.map((pokemon, i) => {
        return <Panel onChange={num => setCard(num)} panelId={i} id={pokedex[i].id} name={pokedex[i].name} types={pokedex[i].types}/>
    })


    return (
        <div>
            <div>
                <div>
                    {}
                </div>
            </div>
            <div>
                {panelCompon}
            </div>
        </div>
    );
}

export default PanelList;

